import React from 'react';
import { NavLink } from 'react-router-dom';
import { Container, Nav, Navbar, NavDropdown } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import companyLogo from './assets/book_my_party-removebg-preview.png'; // Adjust the path if needed
import './assets/css/Header.css'; // External CSS for additional styling

const Header = () => {
  return (
    <header className="header">
      <Navbar expand="lg" className="bg-body-tertiary">
        <Container className="header-container">
          {/* Company Logo */}
          <Navbar.Brand as={NavLink} to="/" className="logo">
            <img src={companyLogo} alt="Company Logo" className="logo-img" />
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            {/* Navigation Links */}
            <Nav className="me-auto nav-left">
              <Nav.Link as={NavLink} to="/">Home</Nav.Link>
              <Nav.Link as={NavLink} to="/about">About</Nav.Link>
              <Nav.Link as={NavLink} to="/services">Services</Nav.Link>
              <NavDropdown title="More" id="basic-nav-dropdown">
                <NavDropdown.Item as={NavLink} to="/contact">Contact</NavDropdown.Item>
                <NavDropdown.Item as={NavLink} to="/faq">FAQ</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item as={NavLink} to="/blog">Blog</NavDropdown.Item>
              </NavDropdown>
            </Nav>
            {/* Login Button */}
            <Nav>
              <Nav.Link as={NavLink} to="/LoginForm" className="login-button">
                Login
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </header>
  );
};

export default Header;
